import React from "react";
import { useNavigate } from "react-router-dom";

import { TelaInicial, Cabecalho, divAumento } from "./estiloHome";

function Home() {
  return (
    <TelaInicial>
      <Cabecalho>
        <h1>Target Music</h1>
        <divAumento></divAumento>
      </Cabecalho>
    </TelaInicial>
  );
}

export default Home;
